import { Parallax } from 'react-scroll-parallax';

const ParallaxImage = () => (
    <Parallax className="custom-class" y={[-20, 20]} tagOuter="figure">
        <Image src="https://www.hampletonpartners.com/fileadmin/user_upload/Industry_News_Images/Tech_M_A_Outlook_2020_PR.jpg" />
    </Parallax>
);

export  default ParallaxImage;
